import { NavLink, useHistory } from "react-router-dom";
import React, { useState } from "react";
import TextList from "../Components/TextList";
import Enum from "../Components/Enum";

function NameEmailForm({ onNext }) {
	const [firstName, setFirstName] = useState("");
	const [lastName, setLastName] = useState("");
	const [email, setEmail] = useState("");

	const handleFirstNameChange = (e) => {
		setFirstName(e.target.value);
	};

	const handleLastNameChange = (e) => {
		setLastName(e.target.value);
	};

	const handleEmailChange = (e) => {
		setEmail(e.target.value);
	};

	const handleSubmit = (event) => {
		event.preventDefault();
		onNext({ firstName, lastName, email });
	};

	return (
		<form className="signup-form" onSubmit={handleSubmit}>
			<div className="name-wrapper">
				<input
					type="text"
					placeholder="First Name"
					name="firstName"
					value={firstName}
					onChange={handleFirstNameChange}
				/>
				<input
					type="text"
					placeholder="Last Name"
					name="lastName"
					value={lastName}
					onChange={handleLastNameChange}
				/>
			</div>
			<label>Email</label>
			<input
				type="email"
				placeholder="Email"
				name="email"
				value={email}
				onChange={handleEmailChange}
			/>
			<div className="button-wrapper">
				<button type="submit">Next</button>
			</div>
		</form>
	);
}

function PasswordCodeForm({ onSignup }) {
	const [password, setPassword] = useState("");
	const [confirmPassword, setConfirmPassword] = useState("");
	const [verificationCode, setVerificationCode] = useState("");

	const handlePasswordChange = (e) => {
		setPassword(e.target.value);
	};

	const handleConfirmPasswordChange = (e) => {
		setConfirmPassword(e.target.value);
	};

	const handleVerificationCodeChange = (e) => {
		setVerificationCode(e.target.value);
	};

	const handleSubmit = (event) => {
		event.preventDefault();
		onSignup({ password, verificationCode });
	};

	return (
		<form className="signup-form" onSubmit={handleSubmit}>
			<label>Password</label>
			<input
				type="password"
				placeholder="Password"
				name="password"
				value={password}
				onChange={handlePasswordChange}
			/>

			<label>Confirm Password</label>
			<input
				type="password"
				placeholder="Confirm Password"
				name="confirmPassword"
				value={confirmPassword}
				onChange={handleConfirmPasswordChange}
			/>

			<label>Verification Code</label>
			<input
				type="text"
				placeholder="Enter Verification Code"
				name="verificationCode"
				value={verificationCode}
				onChange={handleVerificationCodeChange}
			/>

			<div className="button-wrapper">
				<button type="submit">Submit</button>
			</div>
		</form>
	);
}

function Signup() {
	const history = useHistory();
	const [step, setStep] = useState(1);
	const [userData, setUserData] = useState(null);

	const handleNext = (data) => {
		setUserData(data);
		setStep(2);
	};

	const handleSignup = (data) => {
		// Process signup data
		const { password, verificationCode } = data;
		// ... perform necessary actions

		// Redirect to the main view or dashboard
		history.push("/dashboard");
	};

	return (
		<div className="signup">
			<div className="form-container">
				{step === 1 && <NameEmailForm onNext={handleNext} />}
				{step === 2 && <PasswordCodeForm onSignup={handleSignup} />}
			</div>
		</div>
	);
}

export default Signup;
